import React, { Component } from "react";
import Counter from "./components/counter";

class App extends Component {
  state = {
    counters: [
      { id: 1, value: 0 },
      { id: 2, value: 0 },
      { id: 3, value: 0 },
      { id: 4, value: 0 }
    ]
  };
  handleIncrement() {
    console.log("Incremented");
  }
  handleDecrement() {
    console.log("Decremented");
  }
  handleDelete() {
    console.log("Deleted");
  }
  render() {
    return (
      <div className="App">
        <Counter counter={this.state.counters[0]} />
      </div>
    );
  }
}

export default App;
